# https://leetcode.com/problems/longest-substring-without-repeating-characters/

import time

class Solution(object):
    def lengthOfLongestSubstring(self,s):
        """
        :type s: str
        :rtype: int
        """

        longest_len = 0
        for a in range(0,len(s)):
            list = []
            list.append(s[a])

            for b in range(a+1,len(s)):
                if not s[b] in list:
                    list.append(s[b])
                    print(list)
                else: break

            if len(list) > longest_len:
                longest_len = len(list)

        return longest_len


    def betterLengthOfLongestSubstring(self, s):
        longest_len = 0
        a = 0
        if len(s) == 1:
            longest_len = 1
        else:
            while a < len(s)-1:
                list = []
                list.append(s[a])
                a = a+1
                for b in range(a,len(s)):
                    if not s[b] in list:
                        list.append(s[b])
                        # print(list)
                    else:
                        a = a + list.index(s[b])
                        # print(a)
                        break
                if len(list) > longest_len:
                    longest_len = len(list)

        return longest_len

# could use hashset to optmize the algorithm

    def hashSetLongestSubstring(self, s):
        str_length = len(s)
        if str_length == 0:
            return 0
        else:
            a = 0
            b = 1
            max_len = 1
            while a < str_length and b < str_length:
                substr = set(s[a:b])
                if s[b] in substr:
                    a = a + 1
                    print(substr)
                else:
                    b = b + 1
                    substr = set(s[a:b])
                    if len(substr) > max_len:
                        max_len = len(substr)
                    print(substr)
            return max_len



